import './css/Learning.css';
import React from 'react';

function Button({ name, src, alt }) {
    return (
        <a href="#"><img src={src} className={name} alt={alt} /></a>
    );
}

function Comprehension(props) {
    flag = false;
    if (props.name === 'Comprehension') {
        return (
            <div className='Learning_Container'>
                <div className='LearningWon'>
                        <ul>
                            <li className='Comprehension_problem'>!
                            </li>
                            <li className='Comprehension_Button_A' />
                            <li className='Comprehension_Button_B' />
                            <li className='Comprehension_Button_C' />
                        </ul>
                </div>
            </div>
        );
    }
}

function Treatment(props) {
    if (props.name === 'Treatment') {
        return (
            <div className='Learning_Container'>
                <div className='LearningWon'>

                </div>
            </div>
        );
    }
}

export default function Learning() {
    let flag = false;
    if (flag === false) {
        return (
            <div>
            <a href="src/components/Home.js"><button className='Home_Button'>Home</button></a>
            <Button name='Learning_Button_Left' src='/Left.png' alt="Left navigation button" />
            <div className='Learning_Book_Left'></div>
            <div className='Learning_Book_Right'></div>
            <Button name='Learning_Button_Right' src='/Right.png' alt="Right navigation button" />
        </div>
        );
    } else if (flag === true) {
        return (
            <div>
                <a href="src/components/Home.js"><button className='Home_Button'>Home</button></a>
                <Comprehension name='Comprehension' />
                <Button name='Learning_Button_Left' src='/Left.png' alt="Left navigation button" />
                <div className='Learning_Book_Left'></div>
                <div className='Learning_Book_Right'></div>
                <Button name='Learning_Button_Right' src='/Right.png' alt="Right navigation button" />
            </div>
        )
    }
}
